import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "./styles.css";

const Dashboard = ({ setIsLoggedIn }) => {
  const navigate = useNavigate();
  const [savedUrls, setSavedUrls] = useState([]);
  const [newUrl, setNewUrl] = useState("");

  useEffect(() => {
    const userId = localStorage.getItem("userId");
    if (!userId) {
      console.warn("No userId found. Redirecting to login.");
      navigate("/login");
      return;
    }

    fetch(`http://localhost:8081/urls/${userId}`)
      .then((res) => res.json())
      .then((data) => {
        setSavedUrls(
          data.map((item) => ({
            id: item.url_id,
            url: item.url,
            ssl: item.ssl,
            responseCode: item.resCode,
            headers: item.resHead,
            cipher: item.sslPro,
            selected: false,
          }))
        );
      })
      .catch((err) =>
        console.error("Error fetching user-specific URLs:", err)
      );
  }, [navigate]);

  const handleAddUrl = () => {
    if (newUrl.trim() === "") return;

    const userId = localStorage.getItem("userId");
    fetch("http://localhost:8081/url", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        name: "User URL",
        url: newUrl,
        userId: userId,
      }),
    })
      .then((res) => res.json())
      .then((data) => {
        const newEntry = {
          id: data.url_id,
          url: data.url,
          ssl: data.ssl,
          responseCode: data.resCode,
          headers: data.resHead,
          cipher: data.sslPro,
          selected: false,
        };
        setSavedUrls((prevUrls) => [...prevUrls, newEntry]);
        setNewUrl("");
      })
      .catch((err) => console.error("Error saving URL:", err));
  };

  const handleDeleteSelected = () => {
    const selectedIds = savedUrls
      .filter((url) => url.selected)
      .map((url) => url.id);
    if (selectedIds.length === 0) return;

    fetch("http://localhost:8081/urls", {
      method: "DELETE",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(selectedIds),
    })
      .then(() => {
        setSavedUrls((prev) =>
          prev.filter((url) => !selectedIds.includes(url.id))
        );
      })
      .catch((err) => console.error("Error deleting selected URLs:", err));
  };

  return (
    <div className="dashboard">
      <header className="header">
        <img
          src="/images/Headerlogo.png"
          alt="Commerce Bank Logo"
          className="logo"
        />
        <h1>Commerce Bank: URL Checking System</h1>
      </header>

      <div className="logout-container">
        <button
          className="logout-btn"
          onClick={() => {
            localStorage.clear();
            setIsLoggedIn(false);
            navigate("/login");
          }}
        >
          Logout
        </button>
      </div>

      <h2>Your Saved URLs</h2>
      <input
        type="text"
        placeholder="Enter a new URL"
        value={newUrl}
        onChange={(e) => setNewUrl(e.target.value)}
      />
      <button 
       className="add-btn" 
       onClick={handleAddUrl} 
       style={{ backgroundColor: "green", color: "white", marginLeft: "10px" }}>
        Add URL
      </button>
      <button className="edit-btn">Edit Selected</button>
      <button className="rescan-btn">Rescan Selected</button>
      <button
        className="delete-btn"
        onClick={handleDeleteSelected}
        style={{ backgroundColor: "red", color: "white", marginLeft: "10px" }}
      >
        Delete Selected
      </button>

      <table>
        <thead>
          <tr>
            <th>Select</th>
            <th>URL</th>
            <th>SSL Certificates</th>
            <th>Response Code</th>
            <th>Response Headers</th>
            <th>SSL Protocol/Cipher Used</th>
          </tr>
        </thead>
        <tbody>
          {savedUrls.map((savedUrl) => (
            <tr key={savedUrl.id}>
              <td>
                <input
                  type="checkbox"
                  checked={savedUrl.selected || false}
                  onChange={() =>
                    setSavedUrls((prev) =>
                      prev.map((url) =>
                        url.id === savedUrl.id
                          ? { ...url, selected: !url.selected }
                          : url
                      )
                    )
                  }
                />
              </td>
              <td contentEditable>{savedUrl.url}</td>
              <td>{savedUrl.ssl}</td>
              <td>{savedUrl.responseCode}</td>
              <td>{savedUrl.headers}</td>
              <td>{savedUrl.cipher}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
